    { name = "pytest-cov" },
    { name = "ruff" },
]

[package.metadata]
requires-dist = [
    { name = "faster-whisper", specifier = ">=1.1.1" },
    { name = "numpy", specifier = ">=2.3.1" },
    { name = "pillow", specifier = ">=11.3.0" },
    { name = "pycairo", specifier = ">=1.28.0" },
    { name = "pygobject", specifier = ">=3.52.3" },
    { name = "pynput", specifier = ">=1.8.1" },
    { name = "pyobject", specifier = ">=1.3.2" },
    { name = "pystray", specifier = ">=0.19.5" },
    { name = "pyyaml", specifier = ">=6.0.2" },
    { name = "sounddevice", specifier = ">=0.5.2" },
    { name = "soundfile", specifier = ">=0.13.1" },
    { name = "tomli-w", specifier = ">=1.2.0" },
]

[package.metadata.requires-dev]
dev = [
    { name = "pytest", specifier = ">=8.4.1" },
    { name = "pytest-cov", specifier = ">=6.2.1" },
    { name = "ruff", specifier = ">=0.12.4" },
]
